	private val sicMap = HashMap<String, String>()
	private val accountTypeMap = HashMap<String, String>()
	private val filingHistoryDescriptionMap = HashMap<String, String>()

	fun sicLookup(code: String): String {
		return sicMap[code] ?: ""
	}

	fun accountTypeLookup(accountType: String): String {
		return accountTypeMap[accountType] ?: ""
	}

	fun filingHistoryDescriptionLookup(filingHistory: String): String {
		return filingHistoryDescriptionMap[filingHistory] ?: ""
	}

